class PolylineSegment:
    def __init__(self, start_point, end_point, is_arc=False, center=None, radius=None, bulge=None):
        self.start_point = start_point  # 线段起点坐标 [x, y]
        self.end_point = end_point  # 线段终点坐标 [x, y]
        self.is_arc = is_arc  # 是否为弧线段
        self.center = center  # 圆弧中心坐标 [x, y]
        self.radius = radius  # 圆弧半径
        self.bulge = bulge  # 凸度值


class Entity:
    def __init__(self, handle, layer, color, entity_type, points, child_entities=None):
        self.handle = handle  # 实体句柄如'17D62'
        self.layer = layer  # 所属图层
        self.color = color  # 颜色代码
        self.entity_type = entity_type  # 实体类型
        self.points = points  # PolylineSegment对象列表
        self.child_entities = child_entities or []  # 子实体列表


